import React, { useEffect, useState } from 'react';

const Lifecycle = () => {
  const [isvisible, setIsVisible] = useState(false);
  const toggle = () => setIsVisible(!isvisible);

  return (
    <div style={{ padding: 20 }}>
      <button onClick={toggle}></button>
    </div>
  );
};

export default Lifecycle;
